ionship between xml:lang and the html lang attribute).","min":0,"max":"1","type":[{"code":"code"}],"mustSupport":false,"isModifier":false,"isSummary":false,"binding":{"extension":[{"url":"http://hl7.org/fhir/StructureDefinition/elementdefinition-maxValueSet","valueCanonical":"http://hl7.org/fhir/ValueSet/all-languages"},{"url":"http://hl7.org/fhir/StructureDefinition/elementdefinition-bindingName","valueString":"Language"},{"url":"http://hl7.org/fhir/StructureDefinition/elementdefinition-isCommonBinding","valueBoolean":true}],"strength":"preferred","description":"IETF language tag","valueSet":"http://hl7.org/fhir/ValueSet/languages"}}]}};